(()=>{function t(t){console.log("Appending task:",t);var n=$("<li>").addClass("list-group-item"),a=$("<h5>").text(t.name),o=$("<p>").text(t.description);n.append(a,o),$("#taskList").append(n)}$(document).ready((function(){axios.get("http://127.0.0.1:8000/api/items/").then((function(n){console.log("GET response:",n.data),$("#taskList").empty(),Array.isArray(n.data)&&n.data.forEach((function(n){t(n)}))})).catch((function(t){console.log(t)})),$("#todoForm").submit((function(n){n.preventDefault();var a=$("#nameInput").val(),o=$("#descriptionInput").val();axios.post("http://127.0.0.1:8000/api/items/",{name:a,description:o}).then((function(n){console.log("POST response:",n.data),$("#nameInput").val(""),$("#descriptionInput").val(""),t(n.data)})).catch((function(t){console.log(t)}))}))}))})();